
/*Table structure for table `api` */

CREATE TABLE `api` (
  `id` bigint(32) NOT NULL AUTO_INCREMENT,
  `remark` varchar(500) DEFAULT '',
  `url` varchar(200) NOT NULL,
  `is_enable` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

/*Data for the table `api` */



/*Table structure for table `api_access` */

CREATE TABLE `api_access` (
  `id` bigint(32) NOT NULL AUTO_INCREMENT,
  `role_id` bigint(32) NOT NULL,
  `api_id` bigint(32) NOT NULL,
  `decision` tinyint(2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `api_access` */

/*Table structure for table `area_info` */

CREATE TABLE `area_info` (
  `id` int(32) unsigned NOT NULL AUTO_INCREMENT,
  `area_code` varchar(7) NOT NULL,
  `area_name` varchar(20) NOT NULL,
  `area_type` int(1) NOT NULL,
  `parent_code` varchar(7) DEFAULT NULL,
  `remark` varchar(200) DEFAULT '',
  `enable` tinyint(1) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `area_code_index` (`area_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3524 DEFAULT CHARSET=utf8;

/*Data for the table `area_info` */


/*Table structure for table `data_dictionary` */

CREATE TABLE `data_dictionary` (
  `id` int(32) unsigned NOT NULL AUTO_INCREMENT,
  `tree_node_type` int(2) unsigned NOT NULL,
  `father_id` int(32) unsigned NOT NULL DEFAULT '0',
  `label` varchar(100) NOT NULL,
  `type` varchar(100) DEFAULT NULL,
  `value` varchar(500) DEFAULT '',
  `order_num` int(2) unsigned zerofill NOT NULL DEFAULT '00',
  `remark` varchar(1000) DEFAULT '',
  `enable` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `attr_json` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `date_dictionary_type_unique` (`type`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8;

/*Data for the table `data_dictionary` */


/*Table structure for table `menu_element` */

CREATE TABLE `menu_element` (
  `id` bigint(32) NOT NULL AUTO_INCREMENT,
  `menu_id` bigint(32) NOT NULL,
  `element_name` varchar(60) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `menu_element` */

/*Table structure for table `message_info` */

CREATE TABLE `message_info` (
  `id` bigint(32) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(32) DEFAULT NULL,
  `title` varchar(300) DEFAULT NULL,
  `content` varchar(4000) DEFAULT NULL,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `is_read` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `message_info` */

/*Table structure for table `operation_log` */

CREATE TABLE `operation_log` (
  `id` bigint(32) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(32) NOT NULL,
  `ip` varchar(16) NOT NULL,
  `log_type` tinyint(2) NOT NULL DEFAULT '99',
  `message` varchar(2000) NOT NULL,
  `menu_path` varchar(200) DEFAULT NULL,
  `router_path` varchar(200) DEFAULT NULL,
  `api` varchar(200) DEFAULT NULL,
  `proceed_time` bigint(32) DEFAULT '0',
  `time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `operation_log` */

/*Table structure for table `resource_access` */

CREATE TABLE `resource_access` (
  `id` bigint(32) NOT NULL AUTO_INCREMENT,
  `ant_resource` varchar(100) NOT NULL,
  `authorization_type` tinyint(2) NOT NULL DEFAULT '1' COMMENT 'denyAll(1,"denyAll"),\r\npermitAll(2,"permitAll"),\r\nfullyAuthenticated(3,"fullyAuthenticated"),\r\nrememberMe(4,"rememberMe"),\r\nauthenticated(5,"authenticated"),\r\nanonymous(6,"anonymous"),',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

/*Data for the table `resource_access` */


