  `tree_node_type` int(2) unsigned NOT NULL,
  `order_num` int(2) unsigned zerofill NOT NULL DEFAULT '00',
  `menu_path` varchar(100) DEFAULT NULL,
  `menu_name` varchar(100) DEFAULT NULL,
