/*Table structure for table `version_info` */

CREATE TABLE `version_info` (
  `id` bigint(32) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `version_no` varchar(60) DEFAULT NULL COMMENT '版本号',
  `version_content` varchar(4000) DEFAULT NULL COMMENT '版本内容',
  `name` varchar(80) DEFAULT NULL COMMENT '组件名称',
  `report_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '版本上报时间',
  `general_no` varchar(20) DEFAULT NULL COMMENT '总版本号',
  `first_report_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '首次上报时间',
  `is_visible` tinyint(1) DEFAULT '1' COMMENT '是否展示',
  `display_label` varchar(40) DEFAULT NULL COMMENT '页面展示label',
  `publish_date` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `version_info` */

